import React, { useState } from "react";


interface IProps{}
interface IState{}

let Admin:React.FC<IProps> =() =>{

    let [questions, setQuestions] = useState<string>("");


    return(
        <>
          <div className="grid">
            <div className="container">
                <div className="row">
                    <div className="col">
                    <div className="card">
                        <div className="card-header">
                            <h3>Admin Questions</h3>
                            <input type="text" name="question"/>
                            <button className="btn btn-success mt-4 text-center align-content-center">Post Questions</button>
                        </div>
                        <div className="card-body">
                            <h3>Users Replay</h3>
                        </div>
                    </div>
                    </div>
                </div>
            </div>
          </div>

        </>
    );

}

export default Admin;
